import React from 'react'
import {
  Container,
  Fieldset,
  Input,
  Button,
  Dropdown,
  DropdownHeader,
  DropdownBody,
  DropdownItem,
  DropdownItemDot,
  Icon,
} from './styles/form'

export default function Form({ children, ...restProps }: any) {
  return <Container {...restProps}>{children}</Container>
}

Form.Dropdown = function formDropdown({ children, ...restProps }: any) {
  return <Dropdown {...restProps}>{children}</Dropdown>
}

Form.DropdownHeader = function formDropdownHeader({
  children,
  ...restProps
}: any) {
  return <DropdownHeader {...restProps}>{children}</DropdownHeader>
}

Form.DropdownBody = function formDropdownBody({ children, ...restProps }: any) {
  return <DropdownBody {...restProps}>{children}</DropdownBody>
}

Form.DropdownItem = function formDropdownItem({ children, ...restProps }: any) {
  return <DropdownItem {...restProps}>{children}</DropdownItem>
}

Form.DropdownItemDot = function formDropdownItemDot({
  children,
  ...restProps
}: any) {
  return <DropdownItemDot {...restProps}>{children}</DropdownItemDot>
}

Form.Icon = function formIcon({ children, ...restProps }: any) {
  return <Icon {...restProps}>{children}</Icon>
}

Form.Fieldset = function formFieldset({ children, ...restProps }: any) {
  return <Fieldset {...restProps}>{children}</Fieldset>
}
Form.Input = function formInput({ children, ...restProps }: any) {
  return <Input {...restProps}>{children}</Input>
}
Form.Button = function formButton({ children, ...restProps }: any) {
  return <Button {...restProps}>{children}</Button>
}
